import React, { Component } from 'react'

export default class DisplayPaintings extends Component {

    constructor(props) {
        super(props)

        this.state = {
            paintings: []
        }
    }

    render() {
        return (
            <div>
                <h2 className="text"> Paintings Inventory </h2>
            </div>
        )
    }
}
